var checkboxHeight = "21";
var isie8all = (document.all && !document.addEventListener);
if (!isie8all) {
    document.write('<style type="text/css">input[type="checkbox"]{ display: none; }  .disabled { opacity: 0.5; filter: alpha(opacity=50); }</style>');

    var Custom = {
        init: function () {
            var inputs = document.getElementsByTagName("input"), span = Array(), textnode, option, active;
            for (a = 0; a < inputs.length; a++) {

                if (inputs[a].type == "checkbox") {
                    span[a] = document.createElement("span");
                    span[a].className = 'customCheckbox';


                    if (inputs[a].checked == true) {

                        position = "0 -" + (checkboxHeight * 2) + "px";
                        span[a].style.backgroundPosition = position;

                    }
                    inputs[a].parentNode.insertBefore(span[a], inputs[a]);
                    //inputs[a].outerHTML = span[a];

                    inputs[a].onchange = Custom.clear;
                    if (!inputs[a].getAttribute("disabled")) {
                        span[a].onmousedown = Custom.check;
                        //span[a].onmouseup = Custom.check;
                        //span[a].parent().find("label").onmouseup = Custom.check;
                        span[a].onmouseover = Custom.hover;
                        span[a].onmouseout = Custom.unhover;
                    } else {
                        span[a].className = span[a].className += " disabled";
                    }
                }
            }

            document.onmouseup = Custom.clear;
        },
        pushed: function () {
            element = this.nextSibling;
            this.style.backgroundPosition = "-" + checkboxHeight + "px 0";
        },
        check: function () {
            element = this.nextSibling;
            if (element.checked == true && element.type == "checkbox") {
                this.style.backgroundPosition = "-" + checkboxHeight + "px 0";
                element.checked = false;
            } else {
                this.style.backgroundPosition = "-" + checkboxHeight * 2 + "px 0";
                element.checked = true;
            }
        },
        clear: function () {
            inputs = document.getElementsByTagName("input");
            for (var b = 0; b < inputs.length; b++) {
                if (inputs[b].type == "checkbox" && inputs[b].checked == true) {
                    inputs[b].previousSibling.style.backgroundPosition = "-" + checkboxHeight * 2 + "px 0";
                } else if (inputs[b].type == "checkbox") {
                    inputs[b].previousSibling.style.backgroundPosition = "-" + 0 + "px 0";
                }
            }
        },
        hover: function () {
            element = this.nextSibling;
            if (element.checked == false) {
                this.style.backgroundPosition = "-" + checkboxHeight + "px 0";
            }
        },
        unhover: function () {
            element = this.nextSibling;
            if (element.checked == false) {
                this.style.backgroundPosition = "0 0";
            }
        }

    };
    $(function () {
        Custom.init();
    });
}


$(function () {
    $(".ajax").each(function () {
        var disabled = 'custom_disabled';
        var ajaxform = $(this);
        var required = ajaxform.find(".required");
        var form = ajaxform.find("form");
        var btn = form.find("button");
        ajaxform.append("<div class='success'><p class='fbold'>Вы подписались на рассылку!</p></div>");
        var success = ajaxform.find('.success');
        form.css('overflow', 'hidden');
        success.css({
            overflow: "hidden",
            height: "0"
        });

        //required.addClass('empty_field');
        function checkInput() {
            var result = true;
            required.each(function () {
                if ($(this).val() != '') {
                    $(this).removeClass('empty_field');
                    btn.removeClass(disabled);
                } else {
                    $(this).addClass('empty_field');
                    $(this).css("border-color", "#419C62");
                    if (!btn.hasClass(disabled)) {
                        btn.addClass(disabled);
                    }
                    result = false;
                }
            });
            return result;
        }


        required.focus(function () {
            $(this).removeAttr('style');
        });
        btn.click(function (e) {
            e.preventDefault();
            if (checkInput()) {
                if (!$(this).hasClass('wassent')) {
                    $(this).addClass('wassent');
                    $(this).html('Отправка');
                    ajax();
                    return true;
                }
            }
            return false;
        });

        /**
         * отправляет форму, после отправки скрывает форму, показывает сообщение об успешной отправке.
         *
         */
        function ajax() {

            $.post(
                form.attr("action"),
                form.serialize() + "&web_form_submit=Отправить",
                function () {

                    form.animate({height: "toggle"}, 1000, function () {
                        form.hide();
                        var height = success.find('p').css('height');
                        success.animate({height: height}, 500)
                    });
                }
            );
        }
    });
});


/**
 * accordion-tabs
 */
$(function () {

    var tabs = $('#acc-tabs');
    tabs.removeAttr('data-accordion');
    var mobile = window.matchMedia("(max-width: 40em)");
    var notMobile = window.matchMedia("(min-width: 40em)");

    function tabsToAccord() {
        if (tabs.hasClass('tabs') && mobile.matches || tabs.hasClass('accordion') && notMobile.matches) {
            var container = $("#accordion-tabs");
            var tabsContent = container.find('.tabs-content');
            if (tabs.hasClass('tabs') && mobile.matches) {
                tabs.removeClass('tabs').addClass('accordion').removeAttr('data-tab').attr('data-accordion', '1');
                tabs.find('dd').addClass('accordion-navigation');
                tabsContent.hide();
                container.find('.content').each(function () {
                    var content = $(this);
                    container.find('.' + content.attr('id')).find('a').after(content);
                });

            } else if (tabs.hasClass('accordion') && notMobile.matches) {
                tabs.addClass('tabs').removeClass('accordion').removeAttr('data-accordion').attr('data-tab', '1');
                tabs.find('dd').removeClass('accordion-navigation');
                tabsContent.show();
                container.find('.content').each(function () {
                    $(this).appendTo(tabsContent);
                });
            }
        }
    }


    tabsToAccord();
    $(window).resize(function () {
        tabsToAccord();
    });


});


$(function () {
    /**
     * После нажатия на вкладки аккордиона скролит к началу вкладки.
     *
     * @param obj Объект к которому надо сделать скролл
     * @param fix доп отступ
     */
    function checkoffset(obj, fix) {
        setTimeout(function () {
            if (obj.hasClass('active')) {
                var offset = obj.offset().top;
                $(window).scrollTop(offset + fix);
            } else {
                checkoffset(obj, fix);
            }
        }, 5);
    }

    $('.accordion-navigation').on('click', function () {
        checkoffset($(this), -13);
    });


});
$(function () {

    var imgContainer = $('.b-sales-big-pic-block__image-container');
    var btn = $('.b-sales-big-pic-block__show-all-btn');
    var getFullHeight = function () {
        return imgContainer.find('img').height();
    };
    var setHeight = function () {
        imgContainer.animate({
            height: getFullHeight()
        }, 500, function () {
            imgContainer.css('height', 'auto');
        });
    };
    btn.click(function () {
        setHeight();
        $(this).hide();
    });


    /**
     * установка белого фона инпутов при наличии в них текста
     */
    $('input[type="text"], input[type="password"], input[type="date"], input[type="datetime"], input[type="datetime-local"], input[type="month"], input[type="week"], input[type="email"], input[type="number"], input[type="search"], input[type="tel"], input[type="time"], input[type="url"], textarea, select').blur(function () {
        if ($(this).text() == '' && $(this).val() == '') {
            $(this).removeAttr('style');
        } else {
            $(this).css('background-color', 'white');
        }
    });

});


$(function () {
    var toTop = $('.b-btn-to-top');
    toTop.click(function () {
        $('body,html,.off-canvas-wrap').animate({scrollTop: 0 + 'px'}, 800);
    });
    var shown = false;
    $(window).scroll(function () {
        //console.log($(window).scrollTop());
        if ($(window).scrollTop() > 300) {
            if (!shown) {
                toTop.removeClass('fadeOutDown');
                toTop.addClass('fadeInUp');
                shown = true;
            }
        } else {
            if (shown) {
                toTop.removeClass('fadeInUp');
                toTop.addClass('fadeOutDown');
                shown = false;
            }

        }
    });


    var row = $('.fadeInOnWayPoint');
    row.addClass('animated');
    row.waypoint(function(){
        $(this).addClass('fadeIn');
    },{offset: '100%'});

    $('.fade-in-left')
        .waypoint(function(){
            $(this).addClass('fadeInLeft')
        },
        {
            offset:'90%'
        }
    );
    $('.fade-in-right')
        .waypoint(function(){
            $(this).addClass('fadeInRight')
        },
        {
            offset:'90%'
        }
    );
    var clicker = function(obj, text){
        var i = 0;
        var pic = obj;
        var textConteiner = pic.parent().find('.b-person-text__content');
        pic.click(function(){
            i++;
            if(i>30){
                textConteiner.text(text);
            }
        });
    };
    clicker($('.mamay-clicker'), 'Ебашу 24/7');
    clicker($('.derg-clicker'), 'Люблю front-end пожирнее');
    clicker($('.nik-clicker'), 'Хуяк хуяк и в продакшн');
    (function(){
        var i = 0;
        $('.dan-clicker').click(function(){
            if(i++ > 50) document.location.href='http://vk.com/shevlyakov_danil';
        })
    }());
    $('.addMessage').click(function(){
        $('#feedback-form').find('.inputtextarea').text('Меня интересует вакансия '+$(this).data('message'));
    })
});

window.onload = function(){
    var container = $('.b-pics-scroller__inner');
    var width = 0;
    container.find('img').each(function(){
        width += parseInt($(this).width());
    });

    container.width(width+'px');
    container.mousewheel(function(e){
        var left = 0;
        var result = false;
        if(e.deltaY < 0){
            left = parseInt(container.css('left')) + e.deltaY*100;
            var max = $('.b-pics-scroller').width()-container.width();
            if(left < max){
                left = max;
                result = true;
            }
        } else {
            left = parseInt(container.css('left')) + e.deltaY*100;
            if(left > 0){
                left = 0;
                result = true;
            }
        }
        container.css('left',left+'px');
        return result;
    })
};



